export const ALink = ({
  children,
  href,
  target,
  rel,
  linkProps,
  ...otherAProps
}: { linkProps?: LinkProps } & AType) => {
  return (
    <Link {...linkProps} href={href || "#"} passHref>
      <A {...otherAProps} rel={rel} target={target}>
        {children}
      </A>
    </Link>
  );
};
